import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from './Home';
import Create from './Create';

function App() {
  return (
      <Router>
        <Routes>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/create">
            <Create />
          </Route>
          <Route path="/edit/:id">
            <Edit />
          </Route>
        </Routes>
      </Router>
  );
}

export default App;
